import React from 'react';

import Logo from '../../components/Logo';
import LogoTexto from '../../components/LogoTexto';



import { Background, Container, Ima } from './styles';

export default function SplashScreen2() {

    return (
        <Background >
            <Container>
                <Logo />
                <View>
                    <LogoTexto scale={1} />
                </View>
            </Container>
        </Background>
    );

};
